import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import styles from "../styles/mainStyles.module.scss";

function Hero() {
  return (
    <div className={styles.heroStyle}>
      <div className={styles.overlay}>
        <img
          src="https://s3.eu-central-1.amazonaws.com/festivall-bucket/festivals/hero_images/000/003/425/large_webp_2x/d2a2efc11d9753a8556e8e2f13086068.webp?1582570920"
          alt=""
        />
        <Container className={styles.containerStyle}>
          <h2>OSHEAGA</h2>
          <h3>Festival Musique et Arts</h3>
        </Container>
      </div>
    </div>
  );
}

export default Hero;
